Solution.Query:
PREFIX ns1: <https://zbmath.org/> SELECT DISTINCT ?publication WHERE { ?publication ns1:classification ?classification1 . FILTER(CONTAINS(STR(?classification1), "https://zbmath.org/classification/?q=cc%3A20"))
?publication ns1:classification ?classification2 . FILTER(CONTAINS(STR(?classification2), "https://zbmath.org/classification/?q=cc%3A00A71"))
}

